import Head from 'next/head'
import MainLAyout from '../components/Mainlayout'

export default function Home() {
  return (
    <MainLAyout>
      <Head>
        
      </Head>

      <main>
<form className="bookingsContainer">
      
</form>
    
      </main>

      

      <style jsx>{`
        .bookingsContainer {
            background-color: #eee;
            height: 100vh;
            width:100%;

          }

        .bookDetails {
            top:3rem;
            padding-left: 15rem ;
            display: flex;
            justify-content: space-between;
            background-color:white;
            
            }
            @media screen and (max-width: 700px){
            .homeContainer{
            padding-left:10px;
    
            }

      `}</style>
    </MainLAyout>
  )
}
